  render () {
    return (
      <div
        className='App code'
        style={{
          fontFamily: 'monospace',
          textAlign: 'center'
        }}
      >
        <Hero />
        <Stats />
        <Features />
        <Newsletter />
      </div>
    )
  }
}

export default Landing
